import { Box, Container, Typography } from "@mui/material";

const Home = () => {
  return (
    <Box sx={{ width: "100%", boxSizing: "border-box" }}>
      <Box p={5} minHeight={500} display="flex" justifyContent="space-between">
        <Box width="40%" border={"1px solid"}>
          1
        </Box>
        <Box width="40%" border={"1px solid"}>
          2
        </Box>
      </Box>
      <Box p={2} minHeight={500} bgcolor="#f5f5f5" display="flex">
        <Box width="50%">1</Box>
        <Box width="50%">2</Box>
      </Box>
    </Box>
  );
};

export default Home;
